import logo from './logo.svg';
import './StartPage.css';

function StartPage() {
  return (
    <div className="App">
        <div className='image-container'>
          <img src="bike.jpeg" className="App-logo" alt="logo" />
        </div>
    </div>
  );
}

export default StartPage;
